import React from "react";
import Wrapper from '../assets/wrappers/Navbar';

const Navbar = () => {
  return (
    <Wrapper>
      <div className='nav-center'>
        <div className="top-header">
          <div className="top-header-center">
            

          </div>
        </div>
      </div>
    </Wrapper>
  );
};

export default Navbar;
